import React from 'react';
import './ItemInfo.css';

function ItemInfo(props) {
    const item = props.item
    
    return (
        <div class = 'itemInfo_wrap'>
            <div class = 'title'>
                <h3>{item.title}</h3>
            </div>
            <div class = 'dem_or_sup'>
                {item.isDemand ? '필요해요!' : '가져가세요!'}
            </div>
        </div>
    );
}

export default ItemInfo;
